const profile=document.getElementById("profile"),goTo=()=>window.open("https://github.com/cyruzin");profile.addEventListener("click",goTo);const print=document.getElementById("print"),sideMenuLeft=document.getElementById("side-menu-left"),certifications=document.getElementById("certifications"),locationFlag=document.getElementById("location"),contact=document.getElementById("contact"),hideMenu=()=>{sideMenuLeft.style.display="none",certifications.style.display="none",print.style.display="none",locationFlag.style.display="none",contact.style.display="block",window.print()},showMenu=()=>{contact.style.display="none",sideMenuLeft.style.display="block",certifications.style.display="block",print.style.display="block",locationFlag.style.display="flex"};print.addEventListener("click",hideMenu),window.onafterprint=showMenu;